function imgui.Link(link,name,myfunc)
    myfunc = type(name) == 'boolean' and name or myfunc or false
    name = type(name) == 'string' and name or type(name) == 'boolean' and link or link
    local size = imgui.CalcTextSize(name)
    local p = imgui.GetCursorScreenPos()
    local p2 = imgui.GetCursorPos()
    local resultBtn = imgui.InvisibleButton('##'..link..name, size)
    imgui.SetCursorPos(p2)
    if imgui.IsItemHovered() then
        imgui.TextColored(imgui.GetStyle().Colors[imgui.Col.ButtonHovered], name)
        imgui.GetWindowDrawList():AddLine(imgui.ImVec2(p.x, p.y + size.y), imgui.ImVec2(p.x + size.x, p.y + size.y), imgui.GetColorU32(imgui.GetStyle().Colors[imgui.Col.ButtonHovered]))
    else
        imgui.TextColored(imgui.GetStyle().Colors[imgui.Col.ButtonHovered], name)
    end
    return resultBtn
end

function imgui.CenterTextButton(text)
    local width = imgui.GetWindowWidth()
    local size = imgui.CalcTextSize(text)
    local curpos = imgui.GetCursorPos()
    local result = imgui.InvisibleButton('##'..text, size)
    imgui.SetCursorPos(curpos)
    imgui.SetCursorPosX(width/2-size.x/2)
    if imgui.IsItemHovered() then
        imgui.TextColored(imgui.GetStyle().Colors[imgui.Col.ButtonHovered], text)
    else
        imgui.TextColored(imgui.GetStyle().Colors[imgui.Col.Button], text)
    end
    return result
end

