function math.round(num, idp)
    local mult = 10^(idp or 0)
    return math.floor(num * mult + 0.5) / mult
end

function rainbow(speed, alpha, offset)
    local clock = os.clock() + offset
    local r = math.floor(math.sin(clock * speed) * 127 + 128)
    local g = math.floor(math.sin(clock * speed + 2) * 127 + 128)
    local b = math.floor(math.sin(clock * speed + 4) * 127 + 128)
    return r,g,b,alpha
end

function join_argb(a, r, g, b)
    local argb = b
    argb = bit.bor(argb, bit.lshift(g, 8))
    argb = bit.bor(argb, bit.lshift(r, 16))
    argb = bit.bor(argb, bit.lshift(a, 24))
    return argb
end

function CreateSync(type, copy)
    local raknet = require 'samp.raknet'
    local sampfuncs = require 'sampfuncs'

    local trait =
    {
        player = {'PlayerSyncData', raknet.PACKET.PLAYER_SYNC, sampStorePlayerOnfootData},
        vehicle = {'VehicleSyncData', raknet.PACKET.VEHICLE_SYNC, sampStorePlayerIncarData},
        passenger = {'PassengerSyncData', raknet.PACKET.PASSENGER_SYNC, sampStorePlayerPassengerData},
        aim = {'AimSyncData', raknet.PACKET.AIM_SYNC, sampStorePlayerAimData},
        trailer = {'TrailerSyncData', raknet.PACKET.TRAILER_SYNC, sampStorePlayerTrailerData},
        unoccupied = {'UnoccupiedSyncData', raknet.PACKET.UNOCCUPIED_SYNC, nil},
        bullet = {'BulletSyncData', raknet.PACKET.BULLET_SYNC, nil},
        spectator = {'SpectatorSyncData', raknet.PACKET.SPECTATOR_SYNC, nil}
    }
    local dinfo = trait[type]
    local dtype = 'struct '..dinfo[1]
    local data = ffi.new(dtype, {})
    local draw = tonumber(ffi.cast('uintptr_t', ffi.new(dtype..'*', data)))

    copy = copy or true
    if copy then
        local fcopy = dinfo[3]
        if fcopy then
            local _, id
            if copy == true then _, id = sampGetPlayerIdByCharHandle(PLAYER_PED)
            else id = tonumber(copy) end
            fcopy(id, draw)
        end
    end
    local fsend = function()
        local bs = raknetNewBitStream()
        raknetBitStreamWriteInt8(bs, dinfo[2])
        raknetBitStreamWriteBuffer(bs, draw, ffi.sizeof(data))
        raknetSendBitStreamEx(bs, sampfuncs.HIGH_PRIORITY, sampfuncs.UNRELIABLE_SEQUENCED, 1)
        raknetDeleteBitStream(bs)
    end
    local mtype =
    {
    	__index = function(t, index) return data[index] end,
		__newindex = function(t, index, value) data[index] = value end
    }
    return setmetatable({send = fsend}, mtype)
end

