function onWindowMessage(msg, wparam, lparam)
	if msg == 0x100 or msg == 0x101 then
		if (wparam == 0x1B and main_window_state.v) and not funcsinfo and not golinkbhw and not copydiscw and not youtubew and not idcolorsw and not golink2w and not golink1w and not golinkbhofw and not sbrosw and not savesetw and not offscriptw and not reloadscriptw and not changelog and not isGamePaused() and not sampIsChatInputActive() and not isSampfuncsConsoleActive() and not sampIsDialogActive() then
			consumeWindowMessage(true, false)
			if msg == 0x101 then
				main_window_state.v = false
            end
        elseif (wparam == 0x1B and update_window_state.v) and not isGamePaused() and not sampIsChatInputActive() and not isSampfuncsConsoleActive() and not sampIsDialogActive() then
			consumeWindowMessage(true, false)
            if msg == 0x101 then
                update_window_state.v = false
			end
        elseif (wparam == 0x1B and (changelog or funcsinfo or reloadscriptw or offscriptw or savesetw or sbrosw or golinkbhofw or golink1w or golink2w or idcolorsw or youtubew or copydiscw or golinkbhw)) and not isGamePaused() and not sampIsChatInputActive() and not isSampfuncsConsoleActive() and not sampIsDialogActive() then
			consumeWindowMessage(true, false)
            if msg == 0x101 then
                changelog = false
                funcsinfo = false
                reloadscriptw = false
                offscriptw = false
                savesetw = false
                sbrosw = false
                golinkbhofw = false
                golink1w = false
                golink2w = false
                idcolorsw = false
                youtubew = false
                copydiscw = false
                golinkbhw = false
			end
        end
    end
    if tHotKeyData.edit ~= nil and msg == wm.WM_CHAR then
        if tBlockChar[wparam] then
            consumeWindowMessage(true, true)
        end
    end
    if msg == wm.WM_KEYDOWN or msg == wm.WM_SYSKEYDOWN then
        if tHotKeyData.edit ~= nil and wparam == vkeys.VK_ESCAPE then
            tKeys = {}
            tHotKeyData.edit = nil
            consumeWindowMessage(true, true)
        end
        if tHotKeyData.edit ~= nil and wparam == vkeys.VK_BACK then
            tHotKeyData.save = {tHotKeyData.edit, {}}
            tHotKeyData.edit = nil
            consumeWindowMessage(true, true)
        end
        local num = getKeyNumber(wparam)
        if num == -1 then
            tKeys[#tKeys + 1] = wparam
            if tHotKeyData.edit ~= nil then
                if not isKeyModified(wparam) then
                    tHotKeyData.save = {tHotKeyData.edit, tKeys}
                    tHotKeyData.edit = nil
                    tKeys = {}
                    consumeWindowMessage(true, true)
                end
            end
        end
        reloadKeysList()
        if tHotKeyData.edit ~= nil then
            consumeWindowMessage(true, true)
        end
    elseif msg == wm.WM_KEYUP or msg == wm.WM_SYSKEYUP then
        local num = getKeyNumber(wparam)
        if num > -1 then
            tKeys[num] = nil
        end
        reloadKeysList()
        if tHotKeyData.edit ~= nil then
            consumeWindowMessage(true, true)
        end
    end
end

