function whiletrueelements1()
    if checkspeedhack.v and isCharInAnyCar(PLAYER_PED) then
        local veh = storeCarCharIsInNoSave(PLAYER_PED)
        local speed = getCarSpeed(veh)
        if isKeyDown(VK_MENU) and not isGamePaused() and not sampIsChatInputActive() and not isSampfuncsConsoleActive() and not sampIsDialogActive() then
            setCarForwardSpeed(veh, speed + slidespeedhack.v)
            wait(100)
        end
    end
    if checkfastexit.v then
        if isKeysDown(fastExitKey.v) and not isGamePaused() and not sampIsChatInputActive() and not isSampfuncsConsoleActive() and not sampIsDialogActive() then
            if isCharInAnyCar(PLAYER_PED) then
                local posX, posY, posZ = getCarCoordinates(storeCarCharIsInNoSave(PLAYER_PED))
                warpCharFromCarToCoord(PLAYER_PED, posX, posY, posZ)
            else
                imgui.ShowNotify('Доступно только на водительском месте!')
            end
        end
    end
    if checknewspeed.v and isCharInAnyCar(PLAYER_PED) then
        if (servname:find('Arizona Role Play') or servname:find('Arizona RP')) and sampTextdrawIsExists(2070) then
            local carSpeed = math.floor(getCarSpeed(storeCarCharIsInNoSave(PLAYER_PED)) * 3.6)
            if radiospeed.v == 1 then
                if carSpeed > 100 then
                    sampTextdrawSetString(2070, carSpeed)
                elseif carSpeed < 100 then
                    sampTextdrawSetString(2070, '0'..carSpeed)
                elseif carSpeed < 10 then
                    sampTextdrawSetString(2070, '00'..carSpeed)
                end
            elseif radiospeed.v == 2 then
                sampTextdrawSetString(2070, carSpeed)
            end
        elseif servname:find('Advance RolePlay') then
            cars = storeCarCharIsInNoSave(PLAYER_PED)
            speedcar = getCarSpeed(cars)
            TDtext = sampTextdrawGetString(idtextdraw)
            if TDtext:find('Fuel') then
                editVALUE = TDtext:gsub('%d+',math.ceil(speedcar*2),1)
            sampTextdrawSetString(idtextdraw, editVALUE)
            end
        elseif servname:find('Evolve') and sampTextdrawIsExists(2108) then
            local carSpeed = math.floor(getCarSpeed(storeCarCharIsInNoSave(PLAYER_PED)) * 2)
            sampTextdrawSetString(2108, carSpeed)
        elseif (servname:find('Samp') and servname:find('Server 02')) or (servname:find('Samp') and servname:find('Revolution')) or (servname:find('Samp') and servname:find('Classic')) or (servname:find('Samp') and servname:find('Legacy')) then
            if sampTextdrawIsExists(2067) then
                local carSpeed = math.floor(getCarSpeed(storeCarCharIsInNoSave(PLAYER_PED)) * 2)
                sampTextdrawSetString(2067, carSpeed)
            end
        elseif servname:find('Diamond Role Play') and sampTextdrawIsExists(2067) then
            local carSpeed = math.floor(getCarSpeed(storeCarCharIsInNoSave(PLAYER_PED)) * 2.5)
            sampTextdrawSetString(2067, carSpeed)
        end
    end
    if checklodsoff.v then
        writeMemory(0x52C9EE, 1, 1, true)
    else
        writeMemory(0x52C9EE, 1, 0, true)
    end
    -- Функция отключения эффектов. Автор: KiN4StAt (https://www.blast.hk/members/161331/)
    if checkoffeffects.v then
        memory.setuint8(0x4A92A0, 0xE9, true)
        memory.setuint32(0x4A92A1, 0x92, true)
        memory.setuint16(0x4A92A5, 0x9090, true)
    else
        memory.setuint8(0x4A92A0, 0x51, true)
        memory.setuint32(0x4A92A1, 0x862405D9, true)
        memory.setuint16(0x4A92A5, 0x56, true)
    end
    if checknoradio.v then
        memory.copy(0x4EB9A0, memory.strptr('\xC2\x04\x00'), 3, true)
    else
        memory.copy(0x4EB9A0, memory.strptr('\x55\x8B\xE9'), 3, true)
    end
    if checknogears.v then
        if isCharInAnyCar(PLAYER_PED) then
            header = getCarModel(storeCarCharIsInNoSave(PLAYER_PED))
            header = memory.getint32(header * 0x4 + 0xA9B0C8, false)
            header = memory.getint16(header + 0x4A, false)
            memory.setint8(header * 0xE0 + 0xC2B9DC + 0x74, 1, false)
        end
    else
        if isCharInAnyCar(PLAYER_PED) then
            header = getCarModel(storeCarCharIsInNoSave(PLAYER_PED))
            header = memory.getint32(header * 0x4 + 0xA9B0C8, false)
            header = memory.getint16(header + 0x4A, false)
            memory.setint8(header * 0xE0 + 0xC2B9DC + 0x74, 52, false)
        end
    end
    if checkwaterproofeng.v then
        memory.write(0x6CC303, 0x621F8A, 3, true)
        memory.write(0x6A90C5, 0xEB, 1, true)
    else
        memory.write(0x6CC303, 0xEFE180, 3, true)
        memory.write(0x6A90C5, 0x7a, 1, true)
    end
    if checkdriveunderwater.v and isCharInAnyCar(PLAYER_PED) then
        memory.setuint8(0x6C2759, 1, false)
    else
        memory.setuint8(0x6C2759, 0, false)
    end
    if checknohelibl.v and isCarEngineOn(storeCarCharIsInNoSave(PLAYER_PED)) and isCharInAnyHeli(PLAYER_PED) then
        wait(50)
        setHeliBladesFullSpeed(storeCarCharIsInNoSave(PLAYER_PED))
    else
        wait(1)
    end
    if checkdrift.v and isCharInAnyCar(PLAYER_PED) and not isCharOnAnyBike(PLAYER_PED) then
        local car = storeCarCharIsInNoSave(PLAYER_PED)
        local speed = getCarSpeed(car)
        setCarCollision(car, true)
        if isKeyDown(VK_LSHIFT) and not isGamePaused() and not sampIsChatInputActive() and not isSampfuncsConsoleActive() and not sampIsDialogActive() and isVehicleOnAllWheels(car) and doesVehicleExist(car) and speed > 5.0 then
            setCarCollision(car, false)
            if isCarInAirProper(car) then
                setCarCollision(car, true)
                if isKeyDown(VK_A) and not isGamePaused() and not sampIsChatInputActive() and not isSampfuncsConsoleActive() and not sampIsDialogActive() then 
                    addToCarRotationVelocity(car, 0, 0, 0.15)
                end
                if isKeyDown(VK_D) and not isGamePaused() and not sampIsChatInputActive() and not isSampfuncsConsoleActive() and not sampIsDialogActive() then 			
                    addToCarRotationVelocity(car, 0, 0, -0.15)	
                end
            end
        end
    end
    if checkreversal.v and isKeysDown(reversalKey.v) and not isGamePaused() and not sampIsChatInputActive() and not isSampfuncsConsoleActive() and not sampIsDialogActive() then
        if isCharInAnyCar(PLAYER_PED) then
            local cVecX, cVecY, cVecZ = getCarSpeedVector(storeCarCharIsInNoSave(PLAYER_PED))
            applyForceToCar(storeCarCharIsInNoSave(PLAYER_PED), -cVecX / 25, -cVecY / 25, -cVecZ / 25, 0.0, 0.0, 0.0)
            local x, y, z, w = getVehicleQuaternion(storeCarCharIsInNoSave(PLAYER_PED))
            local matrix = {convertQuaternionToMatrix(w, x, y, z)}
            matrix[1] = -matrix[1]
            matrix[2] = -matrix[2]
            matrix[4] = -matrix[4]
            matrix[5] = -matrix[5]
            matrix[7] = -matrix[7]
            matrix[8] = -matrix[8]
            local w, x, y, z = convertMatrixToQuaternion(matrix[1], matrix[2], matrix[3], matrix[4], matrix[5], matrix[6], matrix[7], matrix[8], matrix[9])
            setVehicleQuaternion(storeCarCharIsInNoSave(PLAYER_PED), x, y, z, w)
            setCarForwardSpeed(storeCarCharIsInNoSave(PLAYER_PED), 0.0)
        else
            imgui.ShowNotify('Доступно только на водительском месте!')
        end
    end
    if checktmode.v and isCharInAnyCar(PLAYER_PED) then
        setCarHeavy(storeCarCharIsInNoSave(PLAYER_PED), true)
    else
        if isCharInAnyCar(PLAYER_PED) then
            setCarHeavy(storeCarCharIsInNoSave(PLAYER_PED), false)
        end
    end
    if checknobike.v then
        if isKeysDown(nobikeKey.v) and not checkactwhendrive.v and not isGamePaused() and not sampIsChatInputActive() and not isSampfuncsConsoleActive() and not sampIsDialogActive() then
            mainIni.set.nobikeact = not mainIni.set.nobikeact
            inicfg.save(mainIni, file)
            if mainIni.set.nobikeact then
                imgui.ShowNotify('Антипадение активировано!')
            else
                imgui.ShowNotify('Антипадение деактивировано!')
            end
        end
        if mainIni.set.nobikeact then
            if checkoffinwater.v and not checkactwhendrive.v and isCharOnAnyBike(PLAYER_PED) and isCarInWater(storeCarCharIsInNoSave(PLAYER_PED)) then
                setCharCanBeKnockedOffBike(PLAYER_PED, false)
            elseif checkoffifbikeistouchingcar.v and not checkactwhendrive.v and isCharOnAnyBike(PLAYER_PED) and isCarTouchingCar(storeCarCharIsInNoSave(PLAYER_PED), getClosestCar()) then
                setCharCanBeKnockedOffBike(PLAYER_PED, false)
            elseif checkoffifbikeistouchingplayer.v and not checkactwhendrive.v and isCharOnAnyBike(PLAYER_PED) and isCharTouchingVehicle(getClosestPlayer(), storeCarCharIsInNoSave(PLAYER_PED)) then
                setCharCanBeKnockedOffBike(PLAYER_PED, false)
            elseif checkoffinafk.v and not checkactwhendrive.v and isCharOnAnyBike(PLAYER_PED) and isGamePaused() then
                setCharCanBeKnockedOffBike(PLAYER_PED, false)
            elseif checkoffifengisoff.v and not checkactwhendrive.v and isCharOnAnyBike(PLAYER_PED) and not isCarEngineOn(storeCarCharIsInNoSave(PLAYER_PED)) then
                setCharCanBeKnockedOffBike(PLAYER_PED, false)
            else
                if not checkactwhendrive.v then
                    if math.random(1, 100) < slidefallchance.v then
                        setCharCanBeKnockedOffBike(PLAYER_PED, false)
                    else
                        setCharCanBeKnockedOffBike(PLAYER_PED, true)
                    end
                end
            end
        else
            if not checkactwhendrive.v then
                setCharCanBeKnockedOffBike(PLAYER_PED, false)
            end
        end
        if checkactwhendrive.v then
            if isKeyDown(0x57) and not isGamePaused() and not sampIsChatInputActive() and not isSampfuncsConsoleActive() and not sampIsDialogActive() then
                if isCharOnAnyBike(PLAYER_PED) then
                    if math.random(1, 100) < slidefallchance.v then
                        setCharCanBeKnockedOffBike(PLAYER_PED, false)
                    else
                        setCharCanBeKnockedOffBike(PLAYER_PED, true)
                    end
                end
            else
                setCharCanBeKnockedOffBike(PLAYER_PED, false)
            end
        end
    else
        setCharCanBeKnockedOffBike(PLAYER_PED, false)
    end
    if checkshowcarname.v then
        if isCharInAnyCar(PLAYER_PED) then
            if isPlayerInCar then
                isPlayerInCar = false
                printStyledString(getCarNamebyModel(getCarModel(storeCarCharIsInNoSave(PLAYER_PED))),1500,2)
            end
        else
            isPlayerInCar = true
        end
    end
end

function whiletrueelements2()
    if checkpiemenu.v then
        if checkpieonoff.v then
