            elseif combodl.v == 3 then
                if radiodllang.v == 1 then
                    ffi.copy(ffi.cast('void*', address), 'ИД: %d, Тип: %d, Подтип: %d, Здоровье: %.1f', 0x87) 
                    memory.protect(address, protect)
                elseif radiodllang.v == 2 then
                    ffi.copy(ffi.cast('void*', address), 'ID: %d, Type: %d, SubType: %d, Health: %.1f', 0x87) 
                    memory.protect(address, protect)
                end
            elseif combodl.v == 4  then
                if radiodllang.v == 1 then
                    ffi.copy(ffi.cast('void*', address), 'ИД: %d, Тип: %d, Подтип: %d, Здоровье: %.1f, Предв. загр.: %u', 0x87) 
                    memory.protect(address, protect)
                elseif radiodllang.v == 2 then
                    ffi.copy(ffi.cast('void*', address), 'ID: %d, Type: %d, SubType: %d, Health: %.1f, Preloaded: %u', 0x87) 
                    memory.protect(address, protect)
                end
            elseif combodl.v == 5 then
                if radiodllang.v == 1 then
                    ffi.copy(ffi.cast('void*', address), 'ИД: %d, Тип: %d, Подтип: %d, Здоровье: %.1f, Предв. загр.: %u\nДистанция: %.2fм', 0x87) 
                    memory.protect(address, protect)
                elseif radiodllang.v == 2 then
                    ffi.copy(ffi.cast('void*', address), 'ID: %d, Type: %d, SubType: %d, Health: %.1f, Preloaded: %u\nDistance: %.2fm', 0x87) 
                    memory.protect(address, protect)
                end
            elseif combodl.v == 6 then
                if radiodllang.v == 1 then
                    ffi.copy(ffi.cast('void*', address), 'ИД: %d, Тип: %d, Подтип: %d, Здоровье: %.1f, Предв. загр.: %u\nДистанция: %.2fм\nПассажирские места: %u', 0x87) 
                    memory.protect(address, protect)
                elseif radiodllang.v == 2 then
                    ffi.copy(ffi.cast('void*', address), 'ID: %d, Type: %d, SubType: %d, Health: %.1f, Preloaded: %u\nDistance: %.2fm\nPassengerSeats: %u', 0x87) 
                    memory.protect(address, protect)
                end
            elseif combodl.v == 7 then
                if radiodllang.v == 1 then
                    ffi.copy(ffi.cast('void*', address), 'ИД: %d, Тип: %d, Подтип: %d, Здоровье: %.1f, Предв. загр.: %u\nДистанция: %.2fм\nПассажирские места: %u\nПозиция C: %.3f,%.3f,%.3f', 0x87) 
                    memory.protect(address, protect)
                elseif radiodllang.v == 2 then
                    ffi.copy(ffi.cast('void*', address), 'ID: %d, Type: %d, SubType: %d, Health: %.1f, Preloaded: %u\nDistance: %.2fm\nPassengerSeats: %u\ncPos: %.3f,%.3f,%.3f', 0x87) 
                    memory.protect(address, protect)
                end
            elseif combodl.v == 8 then
                if radiodllang.v == 1 then
                    ffi.copy(ffi.cast('void*', address), 'ИД: %d, Тип: %d, Подтип: %d, Здоровье: %.1f, Предв. загр.: %u\nДистанция: %.2fм\nПассажирские места: %u\nПозиция C: %.3f,%.3f,%.3f\nПозиция S: %.3f,%.3f,%.3f', 0x100) 
                    memory.protect(address, protect)
                elseif radiodllang.v == 2 then
                    ffi.copy(ffi.cast('void*', address), 'ID: %d, Type: %d, SubType: %d, Health: %.1f, Preloaded: %u\nDistance: %.2fm\nPassengerSeats: %u\ncPos: %.3f,%.3f,%.3f\nsPos: %.3f,%.3f,%.3f', 0x100) 
                    memory.protect(address, protect)
                end
            end
        else
            ffi.copy(ffi.cast('void*', address), '', 0x87) 
            memory.protect(address, protect)
        end
    else
        local address = sampGetBase() + 0xD83A8
        local protect = memory.unprotect(address, 0x87)
        if not newdlact then
            ffi.copy(ffi.cast('void*', address), '[id: %d, type: %d subtype: %d Health: %.1f preloaded: %u]\nDistance: %.2fm\nPassengerSeats: %u\ncPos: %.3f,%.3f,%.3f\nsPos: %.3f,%.3f,%.3f', 0x87) 
            memory.protect(address, protect)
        else
            ffi.copy(ffi.cast('void*', address), '', 0x87) 
            memory.protect(address, protect)
        end
    end
    if checkbikebug.v and isCharOnAnyBike(PLAYER_PED) then
        if isKeysDown(bugBikeKey.v) and not isGamePaused() and not sampIsChatInputActive() and not isSampfuncsConsoleActive() and not sampIsDialogActive() then
            if bike[getCarModel(storeCarCharIsInNoSave(PLAYER_PED))] then
                setVirtualKeyDown(0x11, true)
                wait(300)
                setVirtualKeyDown(0x11, false)
                local cVecX, cVecY, cVecZ = getCarSpeedVector(storeCarCharIsInNoSave(PLAYER_PED))
                if not isCarInAirProper(storeCarCharIsInNoSave(PLAYER_PED)) and cVecZ < 7.0 then
                    applyForceToCar(storeCarCharIsInNoSave(PLAYER_PED), 0.0, 0.0, 0.44, 0.0, 0.0, 0.0)
                end
            else
                imgui.ShowNotify('Доступно только на велосипеде!')
            end
        end
    end
    if checkantibreak.v and isCharInAnyCar(PLAYER_PED) then
        local veh = storeCarCharIsInNoSave(PLAYER_PED)
        if isCarVisiblyDamaged(veh) then
            setCarEngineBroken(veh, false)
        end
    end
end

