function cmdelements()
    imgui.CenterText(fa.ICON_FA_TERMINAL..u8' Команда')
    imgui.Separator()
    imgui.PushItemWidth(98)
    if imgui.InputText('##owncmd', text_buffer) then
        sampUnregisterChatCommand(u8:decode(mainIni.main.cmd))
        mainIni.main.cmd = text_buffer.v
        sampRegisterChatCommand(tostring(u8:decode(mainIni.main.cmd)), function()
            if not update_window_state.v and not setcurpos then
                main_window_state.v = not main_window_state.v
            end
        end)
    end
    imgui.SameLine()
    imgui.TextQuestion(u8'Смена команды активации меню скрипта (писать без "/").')
end

function otherelements()
    imgui.CenterText(fa.ICON_FA_CHEVRON_CIRCLE_UP..u8' Другое')
    imgui.Separator()
    if imgui.Selectable(fa.ICON_FA_INFO..u8' ID цветов т/с') then
        idcolorsw = not idcolorsw
    end
    if idcolorsw then
        imgui.OpenPopup("##idcolors")
        imgui.SetNextWindowSize(imgui.ImVec2(800, 425), imgui.Cond.FirstUseEver)
        if imgui.BeginPopupModal('##idcolors', false, imgui.WindowFlags.NoTitleBar + imgui.WindowFlags.NoResize) then
            lua_thread.create(function()
                while not idcolors_data do wait(0) end
                idcolors_data_mem = require('memory').strptr(idcolors_data)
                img = imgui.CreateTextureFromMemory(idcolors_data_mem,#idcolors_data)
            end)
            imgui.Image(img, imgui.ImVec2(792, 363))
            imgui.Text('\n')
            local wid = imgui.GetWindowWidth()
            imgui.SetCursorPosX(wid / 2 - 50)
            if imgui.Button(u8'Закрыть',imgui.ImVec2(100,30)) then
                idcolorsw = not idcolorsw
            end
            if wasKeyPressed(VK_RETURN) and not isGamePaused() and not sampIsChatInputActive() and not isSampfuncsConsoleActive() and not sampIsDialogActive() then
                idcolorsw = not idcolorsw
            end
            imgui.EndPopup()
        end
    end
end

