    imgui.BeginGroup()
    imgui.Checkbox(u8'Открыть/Закрыть личное т/с', checkopencar)
    imgui.SameLine()
    if servname:find('Arizona Role Play') or servname:find('Arizona RP') then
        imgui.TextQuestion(u8'При нажатии на "'..table.concat(getKeysName(OpenMyCar.v), " + ")..u8'"(поддерживает HotKey) прописывает /lock. Также есть функция открытия/закрытия вашего личного т/с через диалог с помощью команды.')
    elseif servname:find('Advance RolePlay') then
        imgui.TextQuestion(u8'При нажатии на "'..table.concat(getKeysName(OpenMyCar.v), " + ")..u8'"(поддерживает HotKey) прописывает /lock 1.')
    else
        imgui.TextQuestion(u8'При нажатии на "'..table.concat(getKeysName(OpenMyCar.v), " + ")..u8'"(поддерживает HotKey) прописывает /lock.')
    end
    if checkopencar.v then
        imgui.SameLine()
        imgui.HotKey('##OpenMyCar',OpenMyCar,{},70)
        if servname:find('Arizona Role Play') or servname:find('Arizona RP') then
            imgui.Text('')
            imgui.SameLine(20)
            imgui.BeginGroup()
            imgui.Checkbox(u8'Через /cars или /keys', checklockcars)
            imgui.SameLine()
            imgui.TextQuestion(u8'Открытие/Закрытие вашего т/с через /cars или /keys с помощью команды. /cars - "/'..u8:decode(mainIni.set.lockcmd)..u8' [1-5]"(можно изменить), /keys - "/'..u8:decode(mainIni.set.lockarcmd)..u8' [1-5]"(можно изменить).')
            if checklockcars.v then
                imgui.Text('')
                imgui.SameLine(20)
                imgui.BeginGroup()
                sampUnregisterChatCommand(u8:decode(mainIni.set.lockcmd))
                sampRegisterChatCommand(tostring(u8:decode(mainIni.set.lockcmd)), function (arg)
                    arg = tonumber(arg)
                    if arg and arg < 6 and arg > 0 then
                        sendLock(arg)
                    else
                        imgui.ShowNotify('Используйте /'..u8:decode(mainIni.set.lockcmd)..' [1-5]')
                    end
                end)
                imgui.PushItemWidth(117)
                if imgui.InputText('##inputlockcmd', text_buffer7) then
                    sampUnregisterChatCommand(u8:decode(mainIni.set.lockcmd))
                    mainIni.set.lockcmd = text_buffer7.v
                    sampRegisterChatCommand(tostring(u8:decode(mainIni.set.lockcmd)), function (arg)
                        arg = tonumber(arg)
                        if arg and arg < 6 and arg > 0 then
                            sendLock(arg)
                        else
                            imgui.ShowNotify('Используйте /'..u8:decode(mainIni.set.lockcmd)..' [1-5]')
                        end
                    end)
                end
