function infobarelements()
    posthiswind = imgui.GetWindowPos()
    imgui.SetWindowFontScale(slidefont.v/10)
    local veh = storeCarCharIsInNoSave(PLAYER_PED)
    local vhp = getCarHealth(veh)
    local gid = getCarModel(veh)
    local vehname = getCarNamebyModel(gid)
    local result, sid = sampGetVehicleIdByCarHandle(veh)
    imgui.CenterText(fa.ICON_FA_CAR..fa.ICON_FA_TOOLS..' VehicleTools')
    imgui.Separator()
    if checkcarname.v then
        if gid == 430 or gid == 446 or gid == 452 or gid == 453 or gid == 454 or gid == 472 or gid == 473 or gid == 484 or gid == 493 or gid == 595 then
            if not checkgameid.v then
                imgui.CenterText(fa.ICON_FA_SHIP..' '..vehname)
            else
                imgui.CenterText(fa.ICON_FA_SHIP..' '..vehname..' ['..gid..']')
            end
        elseif gid == 437 then
            if not checkgameid.v then
                imgui.CenterText(fa.ICON_FA_BUS_ALT..' '..vehname)
            else
                imgui.CenterText(fa.ICON_FA_BUS_ALT..' '..vehname..' ['..gid..']')
            end
        elseif gid == 417 or gid == 425 or gid == 447 or gid == 469 or gid == 487 or gid == 488 or gid == 497 or gid == 548 or gid == 563 or gid == 460 or gid == 476 or gid == 511 or gid == 512 or gid == 513 or gid == 519 or gid == 553 or gid == 577 or gid == 592 or gid == 593 then
            if not checkgameid.v then
                imgui.CenterText(fa.ICON_FA_PLANE..' '..vehname)
            else
                imgui.CenterText(fa.ICON_FA_PLANE..' '..vehname..' ['..gid..']')
            end
        elseif gid == 520 then
            if not checkgameid.v then
                imgui.CenterText(fa.ICON_FA_FIGHTER_JET..' '..vehname)
            else
                imgui.CenterText(fa.ICON_FA_FIGHTER_JET..' '..vehname..' ['..gid..']')
            end
        elseif gid == 537 or gid == 538 then
            if not checkgameid.v then
                imgui.CenterText(fa.ICON_FA_TRAIN..' '..vehname)
            else
                imgui.CenterText(fa.ICON_FA_TRAIN..' '..vehname..' ['..gid..']')
            end
        elseif gid == 420 or gid == 438 then
            if not checkgameid.v then
                imgui.CenterText(fa.ICON_FA_TAXI..' '..vehname)
            else
                imgui.CenterText(fa.ICON_FA_TAXI..' '..vehname..' ['..gid..']')
            end
        elseif gid == 416 then
            if not checkgameid.v then
                imgui.CenterText(fa.ICON_FA_AMBULANCE..' '..vehname)
            else
                imgui.CenterText(fa.ICON_FA_AMBULANCE..' '..vehname..' ['..gid..']')
            end
        elseif gid == 481 or gid == 509 or gid == 510 then
            if not checkgameid.v then
                imgui.CenterText(fa.ICON_FA_BICYCLE..' '..vehname)
            else
                imgui.CenterText(fa.ICON_FA_BICYCLE..' '..vehname..' ['..gid..']')
            end
        elseif gid == 448 or gid == 461 or gid == 462 or gid == 463 or gid == 468 or gid == 471 or gid == 521 or gid == 522 or gid == 523 or gid == 581 or gid == 586 then
            if not checkgameid.v then
                imgui.CenterText(fa.ICON_FA_MOTORCYCLE..' '..vehname)
            else
                imgui.CenterText(fa.ICON_FA_MOTORCYCLE..' '..vehname..' ['..gid..']')
            end
        else
            if not checkgameid.v then
                imgui.CenterText(fa.ICON_FA_CAR..' '..vehname)
            else
                imgui.CenterText(fa.ICON_FA_CAR..' '..vehname..' ['..gid..']')
            end
        end
