        if not checkcarname.v then
            imgui.CenterText(fa.ICON_FA_INFO_CIRCLE..u8' Серв. ID: '..sid)
        else
            imgui.CenterText(fa.ICON_FA_INFO_CIRCLE..' ID: '..sid)
        end
    end
    if checkcarhealth.v then
        if vhp < 400 then
            imgui.CenterText(fa.ICON_FA_HEART_BROKEN..' HP: '..vhp)
        else
            imgui.CenterText(fa.ICON_FA_HEART..' HP: '..vhp)
        end
    end
    if checkcarcolors.v then
        local c1, c2 = getCarColours(veh)
        imgui.CenterText(fa.ICON_FA_ADJUST..u8' Цвета: '..c1..', '..c2)
    end
    if checksostdoor.v then
        local DoorsStats = getCarDoorLockStatus(veh)
        if DoorsStats == 0 then
            imgui.CenterText(fa.ICON_FA_DOOR_OPEN..u8' Двери: Открыты')
        elseif DoorsStats == 2 then
            imgui.CenterText(fa.ICON_FA_DOOR_CLOSED..u8' Двери: Закрыты')
        end
    end
    if checkcarlights.v then
        imgui.CenterText(fa.ICON_FA_LIGHTBULB..u8' Фары: '..(isCarLightsOn(veh) and u8'ВКЛ.' or u8'ВЫКЛ.'))
    end
    if checkcareng.v then
        imgui.CenterText(fa.ICON_FA_FIRE_ALT..u8' Двигатель: '..(isCarEngineOn(veh) and u8'ВКЛ.' or u8'ВЫКЛ.'))
    end
    if setcurpos then
        if imgui.CenterTextButton(fa.ICON_FA_SAVE..u8' Сохранить') then
            mainIni.set.infobarposx = posthiswind.x 
            mainIni.set.infobarposy = posthiswind.y
            inicfg.save(mainIni, file)
            setcurpos = false
            main_window_state.v = true
            imgui.ShowNotify('Местоположение виджета сохранено!')
        end
    end
end

-- Основная функция
function main()
    if not isSampLoaded() or not isSampfuncsLoaded() then return end
    while not isSampAvailable() do wait(100) end
    autoupdate('https://www.dropbox.com/s/6f7ve7aphye7y1o/VehicleToolsUpdate.json?dl=1', '##autoupdate', 'https://www.dropbox.com/s/6f7ve7aphye7y1o/VehicleToolsUpdate.json?dl=1')
    imgui.ShowNotify('Успешно загружен!\nКоманда: /'..u8:decode(mainIni.main.cmd)..'\nАвтор: '..table.concat(thisScript().authors, ', ')..'\nВерсия скрипта: '..thisScript().version)
    imgui.ShowCursor = false
    servname = sampGetCurrentServerName()
    lua_thread.create(render)
    for i = 0, 999 do pldata[i] = {goodit = false, count = 0, banned = false} end
    -- Изменение прорисовки /dl с фиксом бага с хп барами. Автор: KiN4StAt (https://www.blast.hk/members/161331/)
    floatDl = allocateMemory(4)
    memory.setfloat(floatDl, 100)
    memory.setuint32(getModuleHandle("samp.dll") + 0x7120F + 0x2, floatDl, true)
    -- Функция отключения показа 3D текста /dl за объектами. Автор: KiN4StAt (https://www.blast.hk/members/161331/)
    if checkdlset.v and checknotshowdlthroughwalls.v then
        memory.setuint8(getModuleHandle("samp.dll") + 0x712DC + 0x1, 1, true)
    else
        memory.setuint8(getModuleHandle("samp.dll") + 0x712DC + 0x1, 0, true)
    end
    -- Функция отключения обводки у 3D текста /dl. Автор: KiN4StAt (https://www.blast.hk/members/161331/)
    if checkdlset.v and checkoffoutlinedl.v then
        memory.setuint8(getModuleHandle("samp.dll") + 0x712DC + 0x3, 0, true)
    else
        memory.setuint8(getModuleHandle("samp.dll") + 0x712DC + 0x3, 1, true)
    end
    -- Шрифт для рендера
    newdlfont = renderCreateFont(u8:decode(mainIni.set.newdlfont), newdlsizefont, 13)
    doorstatfont = renderCreateFont(u8:decode(mainIni.set.doorstatfont), doorstatsizefont, 13)
