-- Отрисовка ImGui
function imgui.OnDrawFrame()
    setstyleandtheme()
    local sw, sh = getScreenResolution()
    if main_window_state.v then
        if new_version_window_state.v and not update_script then
            local wid = imgui.GetWindowWidth()
            local ToScreen = convertGameScreenCoordsToWindowScreenCoords
            local sX, sY = ToScreen(630, 438)
            imgui.SetNextWindowPos(imgui.ImVec2(sX-250, sY-150))
            imgui.SetNextWindowSize(imgui.ImVec2(250, 150), imgui.Cond.FirstUseEver)
            imgui.Begin('##newversionofscript', false, imgui.WindowFlags.NoCollapse + imgui.WindowFlags.NoResize + imgui.WindowFlags.NoScrollbar + imgui.WindowFlags.NoTitleBar + imgui.WindowFlags.NoMove)
            imgui.CenterText(fa.ICON_FA_CAR..fa.ICON_FA_TOOLS..' VehicleTools')
            imgui.Separator()
            imgui.SetCursorPosY(30)
            imgui.CenterText(u8'Было обнаружено обновление!')
            imgui.SetCursorPosY(55)
            imgui.TextColoredRGB(u8'Текущая версия скрипта:{FF0000} '..thisScript().version..u8'\nНовая версия скрипта:{FF0000} '..updateversion, 2)
            imgui.SetCursorPosY(115)
            imgui.SetCursorPosX(wid / 5 - 1)
            if imgui.Button(u8'Установить',imgui.ImVec2(100,30)) then
                update_script = true
            end
            imgui.End()
        end
        imgui.SetNextWindowPos(imgui.ImVec2(sw / 2, sh / 2), imgui.Cond.FirstUseEver, imgui.ImVec2(0.5, 0.5))
        imgui.SetNextWindowSize(imgui.ImVec2(760, 529), imgui.Cond.FirstUseEver)
        imgui.Begin(fa.ICON_FA_CAR..fa.ICON_FA_TOOLS..' VehicleTools', main_window_state, imgui.WindowFlags.NoCollapse + imgui.WindowFlags.NoResize + imgui.WindowFlags.NoScrollbar)
        local wid = imgui.GetWindowWidth()
        imgui.BeginGroup()
        imgui.BeginChild('##child1', imgui.ImVec2(124, 83), true)
        imgui.CenterText(fa.ICON_FA_LIST_ALT..u8' Меню')
        imgui.Separator()
        if imgui.Selectable(fa.ICON_FA_COG..u8' Настройки', selectable1) then list = 1 end
        if imgui.Selectable(fa.ICON_FA_RADIATION_ALT..u8' Читы', selectable2) then list = 2 end
        if imgui.Selectable(fa.ICON_FA_INFO_CIRCLE..u8' Информация', selectable3) then list = 3 end
        imgui.EndChild()
        imgui.BeginChild('##child2', imgui.ImVec2(124, 82), true)
        funcselements()
        imgui.EndChild()
        imgui.BeginChild('##child3', imgui.ImVec2(124, 63), true)
        inisetelements()
        imgui.EndChild()
        imgui.BeginChild('##child4', imgui.ImVec2(124, 158), true)
        interfaceelements()
        imgui.EndChild()
        imgui.BeginChild('##child5', imgui.ImVec2(124, 50), true)
        cmdelements()
        imgui.EndChild()
        imgui.BeginChild('##child6', imgui.ImVec2(124, 45), true)
        otherelements()
        imgui.EndChild()
        imgui.EndGroup()
        imgui.SameLine()
        imgui.BeginGroup()
        imgui.BeginChild('##child7', imgui.ImVec2(623, 501), true)
        if list == nil or list == 1 then
            carmainelements1()
            carmainelements2()
            carmainelements3()
            carspawnelements()
            dopelements()
            selectable1.v = true
        else
            selectable1.v = false
        end
        if list == 2 then
            cheatelements()
            selectable2.v = true
        else
            selectable2.v = false
        end
        if list == 3 then
            infoelements()
            selectable3.v = true
        else
            selectable3.v = false
        end
        imgui.EndChild()
        imgui.EndGroup()
        imgui.End()
    end
    if checkinfobar.v and isCharInAnyCar(PLAYER_PED) then
        imgui.SetNextWindowPos(imgui.ImVec2(infobarposx, infobarposy), imgui.Cond.FirstUseEver)
        imgui.Begin('##infobar', false, imgui.WindowFlags.NoResize + imgui.WindowFlags.NoCollapse + imgui.WindowFlags.NoTitleBar + imgui.WindowFlags.AlwaysAutoResize)
        infobarelements()
        imgui.End()
    end
    if pie_mode.v then
        if imgui.IsMouseClicked(radiopie.v - 1) and not main_window_state.v and not isGamePaused() and not sampIsChatInputActive() and not isSampfuncsConsoleActive() and not sampIsDialogActive() then 
            imgui.OpenPopup('PieMenu')
        end
        if pie.BeginPiePopup('PieMenu', radiopie.v - 1) then
        for k, v in ipairs(pie_elements) do
            if v.next == nil then if pie.PieMenuItem(u8(v.name)) then v.action() end
            elseif type(v.next) == 'table' then drawPieSub(v) end
        end
        pie.EndPiePopup()
        end
    end
    if update_window_state.v then
        main_window_state.v = false
        local wid = imgui.GetWindowWidth()
        imgui.SetNextWindowPos(imgui.ImVec2(sw / 2, sh / 2), imgui.Cond.FirstUseEver, imgui.ImVec2(0.5, 0.5))
        imgui.SetNextWindowSize(imgui.ImVec2(300, 168), imgui.Cond.FirstUseEver)
        imgui.Begin('##updatescriptwindow', false, imgui.WindowFlags.NoCollapse + imgui.WindowFlags.NoResize + imgui.WindowFlags.NoScrollbar + imgui.WindowFlags.NoTitleBar)
        imgui.CenterText(fa.ICON_FA_CAR..fa.ICON_FA_TOOLS..' VehicleTools')
        imgui.Separator()
        imgui.SetCursorPosY(30)
        imgui.CenterText(u8'Было обнаружено обновление!')
        imgui.SetCursorPosY(55)
        imgui.TextColoredRGB(u8'Желаете обновиться с вашей ({FF0000}'..thisScript().version..u8'{FFFFFF})\nдо последней версии ({FF0000}'..updateversion..'{FFFFFF})?', 2)
        imgui.SetCursorPosY(132)
        imgui.SetCursorPosX(wid / 4 - 1)
        if imgui.Button(u8'Да', imgui.ImVec2(50,30)) then
            update_script = true
            update_window_state.v = false
        end
        imgui.SameLine()
        if imgui.Button(u8'Нет',imgui.ImVec2(50,30)) then
            update_script = false
            update_window_state.v = false
        end
        imgui.End()
    end
    onRenderNotification()
end

