function sampev.onServerMessage(color, text)
    servname = sampGetCurrentServerName()
    if checknotf.v and checkfailnotf.v and (servname:find('Arizona Role Play') or servname:find('Arizona RP')) then
        if text == '[Ошибка] {FFFFFF}Изменить стиль езды можно только на авто с Twin-Turbo или на полицейских авто!' then
            imgui.ShowNotify('Изменить стиль езды можно\nтолько на авто с Twin-Turbo\nили на полицейских авто!')
            return false
        elseif text == '[Ошибка] {FFFFFF}Рядом с вами нет транспорта!' then
            imgui.ShowNotify('Рядом с вами нет транспорта!')
            return false
        elseif text == '[Ошибка] {FFFFFF}На сервере нету свободных мест для загрузки транспорта! Попробуйте позже' then
            if radiofailnotf.v == 1 then
                imgui.ShowNotify('На сервере нету свободных мест\nдля загрузки транспорта!\nПопробуйте позже')
            end
            return false
        elseif text == '[Ошибка] {FFFFFF}Это не ваш транспорт!' then
            imgui.ShowNotify('Это не ваш транспорт!')
            return false
        elseif text == 'Доступно только на водительском месте!' then
            imgui.ShowNotify('Доступно только на водительском месте!')
            return false
        elseif text == '[Ошибка] {FFFFFF}Вы не в транспорте!' then
            imgui.ShowNotify('Вы не в транспорте!')
            return false
        elseif text == '[Ошибка] {FFFFFF}Вы должны стоять рядом с транспортом!' then
            imgui.ShowNotify('Вы должны стоять рядом с транспортом!')
            return false
        elseif text == '[Ошибка] {FFFFFF}Вы не в своем авто!' then
            imgui.ShowNotify('Вы не в своем авто!')
            return false
        elseif text == '[Ошибка] {FFFFFF}Вы должны находиться на водительском месте!' then
            imgui.ShowNotify('Вы должны находиться на\nводительском месте!')
            return false
        elseif text == '[Ошибка] {FFFFFF}Вы должны находится на водительском месте!' then
            imgui.ShowNotify('Вы должны находиться на\nводительском месте!')
            return false
        elseif text == '[Ошибка] {FFFFFF}Вы должны стоять у машины!' then
            imgui.ShowNotify('Вы должны стоять у машины!')
            return false
        elseif text == 'Ключи не вставлены' then
            imgui.ShowNotify('Ключи не вставлены')
