        elseif text == '~n~~n~~n~~n~~n~~n~~n~~n~~n~~n~~w~Style: ~r~Sport!' then
            imgui.ShowNotify('Стиль езды изменен на СПОРТИВНЫЙ!')
            return false
        elseif text == '~w~~n~~n~~n~~n~~n~~n~~n~~n~~n~~n~CAR~g~ UNLOCK~n~/jlock' then
            imgui.ShowNotify('Вы ОТКРЫЛИ арендованное т/с')
            return false
        elseif text == '~w~~n~~n~~n~~n~~n~~n~~n~~n~~n~~n~CAR~r~ LOCK~n~/jlock' then
            imgui.ShowNotify('Вы ЗАКРЫЛИ арендованное т/с')
            return false
        elseif text == '~w~~n~~n~~n~~n~~n~~n~~n~~n~~n~~n~CAR~r~ LOCK~n~/olock' then
            imgui.ShowNotify('Вы ЗАКРЫЛИ организационное т/с')
            return false
        elseif text == 'car is ~g~repaired' then
            imgui.ShowNotify('Вы отремонтировали ваше т/с')
            return false
        elseif text == 'car is ~g~refueled' then
            imgui.ShowNotify('Вы заправили ваше т/с')
            return false
        end
    end
    if checkautofill.v and (servname:find('Arizona Role Play') or servname:find('Arizona RP')) then
        if text == '~w~This type of fuel ~r~ is not suitable~w~~n~ for your vehicles!' then
            sampSendClickTextdraw(18)
        end
        if radiofill.v == 1 then
            if text == '~w~' then
                if sampTextdrawIsExists(2106) then
                    sampSendClickTextdraw(2106)
                else
                    sampSendClickTextdraw(2075)
                end
                sampSendClickTextdraw(32)
            end
        end
    end
end

