    if checkantibreak.v then
        return false
    end
end

function sampev.onVehicleSync(playerId, vehicleId, data)
    if checknogood.v then
        if bit.band(data.keysData, 2) == 2 then
            if pldata[playerId].banned then
                data.keysData = data.keysData - 2
                return {playerId, vehicleId, data}
            end
            pldata[playerId].goodit = true
        else
            pldata[playerId].goodit = false
        end
    end
end

function sampev.onSendPlayerSync(data)
    if restream == true then return false end
end

function sampev.onVehicleStreamIn(vehicleId, data)
    if delvehact then
        return false
    end
end

function sampev.onVehicleStreamOut(vehicleId, data)
    if delvehact then
        return false
    end
end

function sampev.onPlayerStreamOut(playerId)
    if checknogood.v then
        pldata[playerId].count = 0
        pldata[playerId].banned = false
    end
end

