-- Автообновление. Ссылка на автора: http://qrlk.me/samp
function autoupdate(json_url, prefix, url)
    local dlstatus = require('moonloader').download_status
    local json = getWorkingDirectory()..'\\'..thisScript().name..'-checkupdate.json'
    if doesFileExist(json) then os.remove(json) end
    int_json_download = downloadUrlToFile(json_url, json,
    function(id, status, p1, p2)
        if status == dlstatus.STATUSEX_ENDDOWNLOAD and int_json_download == id then
            if doesFileExist(json) then
                local f = io.open(json, 'r')
                if f then
                    local info = decodeJson(f:read('*a'))
                    updatelink = info.updateurl
                    updateversion = info.latest
                    fixstate = info.fixstate
                    f:close()
                    os.remove(json)
                    if updateversion ~= thisScript().version then
                        if fixstate == false then
                            if not checknoupdatew.v then
                                update_window_state.v = not update_window_state.v
                            else
                                imgui.ShowNotify('Обнаружено обновление,\nверсия - '..updateversion..'! Вы можете\nобновиться нажав на кнопку\n"Установить"\nв правом нижнем углу, при\nоткрытом меню скрипта')
                            end
                            new_version_window_state.v = true
                        else
                            imgui.ShowNotify('Обнаружено обновление с фиксом\nобязательным к установке!\nОбновление загрузится автоматически')
                            update_script = true
                        end
                        lua_thread.create(function(prefix)
                        while not update_script do wait(100) end
                        local dlstatus = require('moonloader').download_status
                        imgui.ShowNotify('Пытаюсь обновиться c '..thisScript().version..' на '..updateversion)
                        wait(250)
                        int_scr_download = downloadUrlToFile(updatelink, thisScript().path,
                            function(id3, status1, p13, p23)
                            if status1 == dlstatus.STATUS_ENDDOWNLOADDATA and int_scr_download == id3 then
                                imgui.ShowNotify('Загрузка обновления прошла успешно!')
                                imgui.ShowNotify('Посмотреть, что нового можно\nпросто нажав на кнопку "Изменения"\n во вкладке "Функции"')
                                goupdatestatus = true
                                lua_thread.create(function() wait(500) thisScript():reload() end)
                            end
                            if status1 == dlstatus.STATUSEX_ENDDOWNLOAD and int_scr_download == id3 then
                                if goupdatestatus == nil then
                                    imgui.ShowNotify('Обновление прошло неудачно\nЗапускаю устаревшую версию')
                                update = false
                                end
                            end
                            end
                        )
                        end, prefix
                        )
                    else
                        update = false
                    end
                end
            else
                imgui.ShowNotify('Не могу проверить обновление\nВозможно у вас нет подключения\nк интернету или что-то\nблокирует соединение с сервером')
                update = false
            end
        end
    end
    )
end

